import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes"

function render(note){
  return (
    <Note />
  )

}

function App() {
  return (
    <div>
      <Header />
        {notes.map( render)}
      <Footer />
    </div>
  );
}

export default App;
